import mongoose from "mongoose";


const eventSchema = new mongoose.Schema({
    eventname:{
        type:String,
        required:true,
        unique:true,
    },
    organizer:{
        type:mongoose.Schema.Types.ObjectId,
        ref:'Organizer'
    },
    category:{
        type:String,
        required:true,
    },
    startDate:{
        type:mongoose.Schema.Types.Date,
        required:true,
    },
    endDate:{
        type:mongoose.Schema.Types.Date,
        required:true,
    },
    duration:{
        type:Number,
    },
    venue:{
        type:String,
        required:true,
    },
    address: {
        street: { type: String, required: true }, 
